import React from "react";

function Sidebar() {
  return (
    <sidebar className="sidebar">
      <ul>
        <li>
          <a href="#">Top link</a>
        </li>
        <li>
          <a href="#">Top menu 1</a>
        </li>
        <li>
          <a href="#">Top menu 2</a>
        </li>
      </ul>
    </sidebar>
  );
}

export default Sidebar;
